<?php

require("/var/www/html/scripts/library/sendgrid-php/sendgrid-php.php");

try {
	$m = new Mongo();
	$db = $m->LehighHacks;
	$collection = $db->registrants;

	if(isset($_POST['data']))
		addToMongo($_POST['data']);
	else
		error_log("No data received");

} catch(MongoConnectionException $e){
	echo "Error Cannot connect to MongoDB.";
}

function addToMongo($document){
	global $collection;

	$email = $document['email'];

	$emailQuery = array('email' => $email);
	if($collection->find($emailQuery)->count() == 0){
		echo("added-user");
		$collection->insert($document);
		sendEmail($email, $document['firstName']);
	}
	else
		echo("user-exists");
}

